import { Card, CardActions, CardContent, CardMedia, Button, Typography, Grid, createSvgIcon, SvgIcon } from '@material-ui/core';
import FavoriteBorderIcon from '@mui/icons-material/FavoriteBorder';
import FavoriteIcon from '@mui/icons-material/Favorite';

import useStyles from './styles';

const Movie = ({ movie }) => {
    const classes = useStyles();

    return (
        <Card className={classes.card}>
            <CardMedia className={classes.media} image={movie.posterurl} title={movie.title} />
            <div className={classes.overlay}>
                <Typography variant="h4">{movie.title}</Typography>
                <Typography variant="h6">{movie.year}</Typography>           
                <Typography variant="h6">{movie.averageRating}</Typography>
            </div>
            <div className={classes.overlay2}>
                <button backgroundBlendMode='darken' size="small" onClick={() => {}}>
                    <FavoriteBorderIcon fontSize='large' color='primary'>add_circle</FavoriteBorderIcon>
                </button>
            </div>
            {/* <div className={classes.details}>
            </div> */}
            {/* <CardContent>
                <Typography className="classes.title" variant="h5" gutterBottom>{movie.year}</Typography>
            </CardContent> */}
        </Card>
    );
}

export default Movie;
